import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import './App.css'; // Make sure this line is present

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/:mysource" element={<Home />} />
          <Route path="/" element={<Home />} /> {/* Add a default route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
